  <script>
// Inject browser icons next to project names in Playwright HTML report
(function() {
  const BROWSER_ICONS = {
    'Chromium': 'bi-browser-chrome',
    'Firefox': 'bi-browser-firefox',
    'WebKit': 'bi-browser-safari'
  };

  function injectIcons() {
    // Find all text elements that might contain browser names
    const walker = document.createTreeWalker(document.body, NodeFilter.SHOW_TEXT);
    const nodes = [];
    while (walker.nextNode()) nodes.push(walker.currentNode);

    for (const node of nodes) {
      const text = node.textContent || '';
      for (const [browser, iconClass] of Object.entries(BROWSER_ICONS)) {
        // Match project names like "Chromium  Desktop-HD"
        if (text.includes(browser + ' \u00b7 ') && !node.parentElement?.querySelector('.bi')) {
          const icon = document.createElement('i');
          icon.className = 'bi ' + iconClass;
          icon.style.marginRight = '4px';
          node.parentElement?.insertBefore(icon, node);
          break;
        }
      }
    }
  }

  // The Playwright HTML report is a SPA  poll until content renders
  let attempts = 0;
  const interval = setInterval(() => {
    injectIcons();
    attempts++;
    if (attempts >= 30) clearInterval(interval); // stop after ~10s
  }, 300);

  // Also run on route changes (SPA navigation)
  const observer = new MutationObserver(() => injectIcons());
  observer.observe(document.body, { childList: true, subtree: true });
})();
</script>
